// src/pages/AdminPanel.jsx
import { Link, Routes, Route } from 'react-router-dom';
import UsersPanel from './admin/UsersPanel';
import PetsPanel from './admin/PetsPanel';
import ActivitiesPanel from './admin/ActivitiesPanel';
import LostReportsPanel from './admin/LostReportsPanel';
import CommentsPanel from './admin/CommentsPanel';
import StatsPanel from './admin/StatsPanel';

export default function AdminPanel() {
  return (
    <div>
      <h2>Panel de Administración</h2>
      <ul className="list-group mb-4">
        <li className="list-group-item"><Link to="/admin/users">Gestión de Usuarios</Link></li>
        <li className="list-group-item"><Link to="/admin/pets">Gestión de Mascotas</Link></li>
        <li className="list-group-item"><Link to="/admin/activities">Gestión de Actividades</Link></li>
        <li className="list-group-item"><Link to="/admin/reports">Reportes de Mascotas Perdidas</Link></li>
        <li className="list-group-item"><Link to="/admin/comments">Comentarios</Link></li>
        <li className="list-group-item"><Link to="/admin/stats">Estadísticas y Notificaciones</Link></li>
      </ul>

      <Routes>
        <Route path="users" element={<UsersPanel />} />
        <Route path="pets" element={<PetsPanel />} />
        <Route path="activities" element={<ActivitiesPanel />} />
        <Route path="reports" element={<LostReportsPanel />} />
        <Route path="comments" element={<CommentsPanel />} />
        <Route path="stats" element={<StatsPanel />} />
      </Routes>
    </div>
  );
}
